    constructor() {
        super();
        this.state = {
            form: {
                user: "",
                password: "",
            },
            usuario: {},
            logged: null,
            redirect: false,
            perfil: '',            
        }
    }

 
    componentDidMount = () => {        
        localStorage.clear();
    }


   


    render() {
        return (
            <div>
            <h2>Log out</h2>
        </div>
        );        
    }
}
